import React from 'react';
import styled from 'styled-components';

const Nav = () => {
	return (
		<NavContainer>
			<div className="flex-right">
				<ul>
					<li>coucou</li>
					<li>enrevoir</li>
				</ul>
			</div>
		</NavContainer>
	);
};

export default Nav;

const NavContainer = styled.nav`
	.flex-right{
		margin-left: auto;
	}
`;
